fn simple_pieces() {
	let mut pawn_attacks = [[0; 2]; 64];
	let mut knight_attacks = [0; 64];
	let mut king_attacks = [0; 64];


	for square in 0..64 {
		let piece = 1 << square;


		let mut black_pawn_attacks = 0;
		let mut white_pawn_attacks = 0;

		black_pawn_attacks |= (piece << 7) & NOT_A_FILE;
		black_pawn_attacks |= (piece << 9) & NOT_H_FILE;
		white_pawn_attacks |= (piece >> 7) & NOT_H_FILE;
		white_pawn_attacks |= (piece >> 9) & NOT_A_FILE;

		pawn_attacks[square] = [black_pawn_attacks, white_pawn_attacks];


		knight_attacks[square] |= (piece << 17) & NOT_H_FILE;
		knight_attacks[square] |= (piece << 10) & NOT_GH_FILES;
		knight_attacks[square] |= (piece << 6)  & NOT_AB_FILES;
		knight_attacks[square] |= (piece << 15) & NOT_A_FILE;

		knight_attacks[square] |= (piece >> 15) & NOT_H_FILE;
		knight_attacks[square] |= (piece >> 6)  & NOT_GH_FILES;
		knight_attacks[square] |= (piece >> 10) & NOT_AB_FILES;
		knight_attacks[square] |= (piece >> 17) & NOT_A_FILE;


		king_attacks[square] |= (piece << 1) & NOT_H_FILE;
		king_attacks[square] |= (piece >> 1) & NOT_A_FILE;
		king_attacks[square] |= piece << 8;
		king_attacks[square] |= piece >> 8;
		king_attacks[square] |= (piece << 9) & NOT_H_FILE;
		king_attacks[square] |= (piece >> 9) & NOT_A_FILE;
		king_attacks[square] |= (piece << 7) & NOT_A_FILE;
		king_attacks[square] |= (piece >> 7) & NOT_H_FILE;
	}

	let mut output_file = File::create("./data_output.rs").expect("Failed to create output file");
	writeln!(
		output_file,
		"pub const PAWN_ATTACKS: [[u64; 2]; 64] = {:?};
pub const KNIGHT_ATTACKS: [u64; 64] = {:?};
pub const KING_ATTACKS: [u64; 64] = {:?};",
		pawn_attacks,
		knight_attacks,
		king_attacks,
	).expect("Failed to write to output file");
}

fn squares_to_edge() {
	let mut squares_to_edge = [[0; 8]; 64];

	for rank in 0..8 {
		for file in 0..8 {
			for dir in 0..8 {
				let north_to_edge = rank;
				let south_to_edge = 7 - rank;
				let west_to_edge  = file;
				let east_to_edge  = 7 - file;

				squares_to_edge[rank * 8 + file] = [
					north_to_edge,
					east_to_edge,
					south_to_edge,
					west_to_edge,

					usize::min(north_to_edge, east_to_edge),
					usize::min(south_to_edge, east_to_edge),
					usize::min(south_to_edge, west_to_edge),
					usize::min(north_to_edge, west_to_edge),
				];
			}
		}
	}

	let mut output_file = File::create("./data_output.rs").expect("Failed to create output file");
	write!(
		output_file,
		"pub const SQUARES_TO_EDGE: [[i8; 8]; 64] = {:?};",
		squares_to_edge,
	).expect("Failed to write to output file");
}

fn sliding_pieces() {
	let mut bishop_moves: [Vec<u64>; 64] = std::array::from_fn(|_| vec![]);
	let mut bishop_magics = [EMPTY_MAGIC_SQUARE; 64];

	let mut rook_moves: [Vec<u64>; 64] = std::array::from_fn(|_| vec![]);
	let mut rook_magics = [EMPTY_MAGIC_SQUARE; 64];

	let mut rng = thread_rng();

	for square in 0..64 {
		// Calculate relevant occupancy masks
		let mut bishop_mask = 0;
		for dir in BISHOP_DIRECTIONS {
			for n in 1..SQUARES_TO_EDGE[square][dir] {
				let index = (square as i8 + DIRECTION_OFFSETS[dir] * n) as usize;
				bishop_mask |= 1 << index;
			}
		}

		let mut rook_mask = 0;
		for dir in ROOK_DIRECTIONS {
			for n in 1..SQUARES_TO_EDGE[square][dir] {
				let index = (square as i8 + DIRECTION_OFFSETS[dir] * n) as usize;
				rook_mask |= 1 << index;
			}
		}

		println!("Finding magic for {}...", SQUARES[square]);
		(bishop_moves[square], bishop_magics[square]) = find_magic(square, BISHOP_DIRECTIONS, bishop_mask, &mut rng);
		(rook_moves[square], rook_magics[square]) = find_magic(square, ROOK_DIRECTIONS, rook_mask, &mut rng);
	}



	let mut total_size = 0;
	for i in 0..64 {
		total_size += std::mem::size_of::<u64>() * bishop_moves[i].len();
	}
	println!("Bishop table: {:.1} KiB", total_size as f32 / 1024.0);

	let mut total_size = 0;
	for i in 0..64 {
		total_size += std::mem::size_of::<u64>() * rook_moves[i].len();
	}
	println!("Rook table: {:.1} KiB", total_size as f32 / 1024.0);



	println!("Writing to file...");
	let mut output_file = File::create("./data_output.rs").expect("Failed to create output file");

	let mut formatted_bishop_moves = String::new();

	for i in 0..64 {
		formatted_bishop_moves += &format!("&{:?}, ", bishop_moves[i]);
	}

	formatted_bishop_moves.pop(); // remove the last space
	formatted_bishop_moves.pop(); // remove the last comma



	let mut formatted_rook_moves = String::new();

	for i in 0..64 {
		formatted_rook_moves += &format!("&{:?}, ", rook_moves[i]);
	}

	formatted_rook_moves.pop(); // remove the last space
	formatted_rook_moves.pop(); // remove the last comma



	write!(
		output_file,
		"pub const BISHOP_MOVES: [&[u64]; 64] = [{}];
pub const BISHOP_MAGICS: [MagicSquare; 64] = {:?};

pub const ROOK_MOVES: [&[u64]; 64] = [{}];
pub const ROOK_MAGICS: [MagicSquare; 64] = {:?};",
		formatted_bishop_moves,
		bishop_magics,

		formatted_rook_moves,
		rook_magics,
	).expect("Failed to write to output file");

	println!("Done!");
}

pub fn generate_sliding_moves(square: usize, direction_range: Range<usize>, blockers: u64) -> u64 {
	let mut result = 0;

	for dir in direction_range {
		for n in 1..=SQUARES_TO_EDGE[square][dir] {
			let index = (square as i8 + DIRECTION_OFFSETS[dir] * n) as usize;
			result |= 1 << index;

			if blockers & (1 << index) != 0 {
				break;
			}
		}
	}

	result
}

pub fn find_magic(square: usize, direction_range: Range<usize>, mask: u64, rng: &mut ThreadRng) -> (Vec<u64>, MagicSquare) {
	loop {
		let magic = rng.gen_range(0..u64::MAX) & rng.gen_range(0..u64::MAX) & rng.gen_range(0..u64::MAX);
		let index_bits = mask.count_ones() as usize;
		let magic_square = MagicSquare { mask, magic, shift: 64 - index_bits as u8 };

		let mut table = vec![0; 1 << index_bits];
		let mut blockers = 0u64;
		let mut failed = false;

		for _ in 0..table.len() {
			let moves = generate_sliding_moves(square, direction_range.clone(), blockers);
			let magic_index = get_magic_index(&magic_square, blockers);

			if table[magic_index] == 0 {
				table[magic_index] = moves;
			} else {
				failed = true;
				break;
			}

			blockers = blockers.wrapping_sub(magic_square.mask) & magic_square.mask;
		}

		if !failed {
			return (table, magic_square);
		}
	}
}

pub fn get_magic_index(magic: &MagicSquare, occupancies: u64) -> usize {
	let blockers = occupancies & magic.mask;
	let hash = blockers.wrapping_mul(magic.magic);
	(hash >> magic.shift) as usize
}

pub fn get_bishop_moves(square: u8, occupancies: u64) -> u64 {
	let magic = BISHOP_MAGICS[square as usize];
	let moves = BISHOP_MOVES[square as usize];

	moves[get_magic_index(&magic, occupancies)]
}

pub fn get_rook_moves(square: u8, occupancies: u64) -> u64 {
	let magic = ROOK_MAGICS[square as usize];
	let moves = ROOK_MOVES[square as usize];

	moves[get_magic_index(&magic, occupancies)]
}